import React from "react";
import FriendItem from "./FriendItem";

export default function FriendlListItems({ Items }) {
  const showAllItems = Items.length ? (
    Items.map((Item) => <FriendItem Item={Item} />)
  ) : (
    <></>
  );
  return <>{showAllItems}</>;
}
